ineq = np.matrix(ineq)

def milp(rounds, indiv, outdiv, bp):
	# start gurobi
	try:
		# Create Model
		model = gp.Model()

		# ================ ( 1 ) round ================			# ================ ( R ) round ================	
		# X[0] --- Sbox ---> Y[0] --- Perm ---> X[1]			# X[R-1] --- Sbox ---> Y[R-1] --- Perm ---> X[R]	
		X = [model.addMVar(shape = 64, vtype=GRB.BINARY) for r in range(rounds + 1)]
		Y = [model.addMVar(shape = 64, vtype=GRB.BINARY) for r in range(rounds)]

		# Set initial, output div
		indiv = np.array([(indiv>>i)&1 for i in range(64)])
		outdiv = np.array([(outdiv>>i)&1 for i in range(64)])
		model.addConstr(X[0] == indiv)
		model.addConstr(X[rounds] == outdiv)
		
		# Object function : Min(X[rounds][0] + ... ~ ... + X[rounds][63]) 
		obj = np.array([1.0 for x in range(64)])
		model.setObjective(obj @ X[rounds], GRB.MINIMIZE)

		columns = np.array([x for x in range(64)]).reshape(8,8)

		sboxConstr = lambda inVar, outVar: model.addConstr(ineq[:,:8] @ inVar + ineq[:,8:16] @ outVar + np.array(ineq[:,-1]).reshape(-1) >= 0)

		for r in range(rounds):
			# sbox
			for i in range(0,64,8):
				sboxConstr(X[r][i:i+8], Y[r][i:i+8])

			# bit perm
			model.addConstr(Y[r] == X[r+1][bp])

		model.optimize()

		if model.Status == GRB.OPTIMAL:	# If exist sol
			return 'u'
		elif model.Status == GRB.INFEASIBLE:
			return 'b'
		else:
			print("Unknown Error")

	except gp.GurobiError as e:
		print('Error code ' + str(e.errno) + ": " + str(e))

	except AttributeError:
		print('Encountered an attribute error')
